async function* parseFiles(files: FileList): AsyncIterableIterator<Raw.TimelineObject> {
  for (let file of Array.from(files)) {
    if (file.type === 'application/json') {
      try {
        const content = await file.text();
        const json: Raw.SemanticLocationHistory = JSON.parse(content);

        if (json.timelineObjects && Array.isArray(json.timelineObjects)) {
          yield* json.timelineObjects;
        }
      } catch (e) {
        console.error('Error parsing JSON in file:', file.name, e);
      }
    } else {
      console.warn('Skipping non-JSON file:', file.name);
    }
  }
}

/**
 * Pre-processes the data to become usable
 * @param data Raw data read from the uploaded files
 */
function* getCoordinates(data: Iterable<Raw.TimelineObject>): IterableIterator<Processed.Point> {
  for (const timelineObject of data) {
    if (!validateTimelineObject(timelineObject)) {
      continue;
    }

    if (timelineObject.activitySegment) {
      const activitySegment = timelineObject.activitySegment;
      if (activitySegment.confidence === 'LOW' || activitySegment.confidence === 'UNKNOWN_CONFIDENCE') {
        continue;
      }
      if (!activitySegment.simplifiedRawPath?.points) {
        continue;
      }
      for (const point of activitySegment.simplifiedRawPath?.points) {
        yield { latitude: point.latE7 / 10 ** 7, longitude: point.lngE7 / 10 ** 7 };
      }
    }

    if (timelineObject.placeVisit) {
      const placeVisit = timelineObject.placeVisit;
      if (placeVisit.locationConfidence > 30) {
        yield { latitude: placeVisit.centerLatE7 / 10 ** 7, longitude: placeVisit.centerLngE7 / 10 ** 7 };
      }
    }
  }
}

// Main interface
const fileInput = document.getElementById('fileInput') as HTMLInputElement;

// Initalize the map on the div with id "map"
const map = L.map('map').setView(CENTER_COORDINATE, 16);

// Setup map layers
const ESRI_WORLD_IMAGERY = L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/World_Imagery/MapServer/tile/{z}/{y}/{x}', {
  attribution: 'Tiles &copy; Esri &mdash; Source: Esri, i-cubed, USDA, USGS, AEX, GeoEye, Getmapping, Aerogrid, IGN, IGP, UPR-EGP, and the GIS User Community'
})
const ESRI_WORLD_TOPO = L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/World_Topo_Map/MapServer/tile/{z}/{y}/{x}', {
	attribution: 'Tiles &copy; Esri &mdash; Esri, DeLorme, NAVTEQ, TomTom, Intermap, iPC, USGS, FAO, NPS, NRCAN, GeoBase, Kadaster NL, Ordnance Survey, Esri Japan, METI, Esri China (Hong Kong), and the GIS User Community'
})
const OPEN_STREET_MAP = L.tileLayer('https://tile.openstreetmap.org/{z}/{x}/{y}.png', {
	maxZoom: 19,
	attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
});

ESRI_WORLD_IMAGERY.addTo(map);

const baseMaps = {
  "ESRI World Imager": ESRI_WORLD_IMAGERY, 
  "ESRI World Topo": ESRI_WORLD_TOPO, 
  "Open Street Map": OPEN_STREET_MAP
}

// Setup map overlays
var intitutesPolygon = []
var dormsPolygon = []
var attractionsPolygon = []
var servicesPolygon = []

for(let place of INSTITUTES) {
  L.geoJSON(place.geometry as any, {
    style: {"color": "blue", "weight": 0, "fillOpacity": 0}
  }).bindTooltip("Institue").addTo(map)
  intitutesPolygon.push(L.geoJSON(place.geometry as any, {
    style: {"color": "blue", "weight": 1, "fillOpacity": 0.4}
  }))
}

for(let place of DORMS) {
 L.geoJSON(place.geometry as any, {
    style: {"color": "red", "weight": 0, "fillOpacity": 0}
  }).bindTooltip("Dorm").addTo(map)
  dormsPolygon.push(L.geoJSON(place.geometry as any, {
    style: {"color": "red", "weight": 1, "fillOpacity": 0.4}
  }))
}

for(let place of ATTRACTIONS) {
  L.geoJSON(place.geometry as any, {
    style: {"color": "green", "weight": 0, "fillOpacity": 0}
  }).bindTooltip("Attraction").addTo(map)
  attractionsPolygon.push(L.geoJSON(place.geometry as any, {
    style: {"color": "green", "weight": 1, "fillOpacity": 0.4}
  }))
}

for(let place of SERVICES) {
  L.geoJSON(place.geometry as any, {
    style: {"color": "yellow", "weight": 0, "fillOpacity": 0}
  }).bindTooltip("Service").addTo(map)
  servicesPolygon.push(L.geoJSON(place.geometry as any, {
    style: {"color": "yellow", "weight": 1, "fillOpacity": 0.4}
  }))
}

const overlays = {
  "Institutes": L.layerGroup(intitutesPolygon),
  "Dorms": L.layerGroup(dormsPolygon),
  "Attractions": L.layerGroup(attractionsPolygon),
  "Services": L.layerGroup(servicesPolygon)
}

var layerControl = L.control.layers(baseMaps, overlays).addTo(map);

// Make button pressable if agreed checkbox is checked
const checkbox = document.getElementById("agreed") as HTMLInputElement;
const fileLabel = document.querySelector(".file-label") as HTMLLabelElement;

fileLabel.style.pointerEvents = "none";

checkbox.addEventListener("change", function() {
    if (checkbox.checked) {
        fileLabel.style.pointerEvents = "auto";
    } else {
        fileLabel.style.pointerEvents = "none";
    }
});

const overlay = document.querySelector("#overlay") as HTMLDivElement;
const loading = document.querySelector("#loading") as HTMLDivElement;
const ui = document.querySelector("#prompt") as HTMLDivElement;
const generate = document.querySelector("#generate-sample") as HTMLDivElement;

// Generate sample data
generate.addEventListener("click", function () {
  ui.style.display = "none";
  loading.style.display = "flex";
  // Loading animation for natural transition
  setTimeout(function () {
    const mask = L.geoJSON(SAMPLE as any, {
      style: {
        "color": "#ffffff",
        "weight": 0,
        "fillOpacity": 0.9
      }
    }).addTo(map);
    layerControl.addOverlay(L.layerGroup([mask]), "Mask")
    overlay.style.display = "none";
  }, 5000);
})

// Generate from user input
fileInput.addEventListener('change', async () => {
  if (!fileInput.files || fileInput.files.length === 0) {
    alert('No files selected.');
    return;
  }

  ui.style.display = "none";
  loading.style.display = "flex";

  // Process the files
  const timelineObjects = new Array<Raw.TimelineObject>();

  for await (const timelineObject of parseFiles(fileInput.files)) {
    timelineObjects.push(timelineObject)
  }

  const coordinates = Array.from(getCoordinates(timelineObjects));

  // Generate the mask with a worker
  const worker = new Worker('worker.js');
  worker.postMessage({ points: coordinates, BOUNDARY });

  worker.onmessage = function (event) {
    const turfPolygon = event.data;

    const mask = L.geoJSON(turfPolygon.geometry, {
      style: {
        "color": "#ffffff",
        "weight": 0,
        "fillOpacity": 0.9
      }
    }).addTo(map);

    layerControl.addOverlay(L.layerGroup([mask]), "Mask")

    overlay.style.display = "none";
  };
});